import { createContext, useState } from "react";

export const GlobalContext = createContext();

export const GlobalProvider = ({ children }) => {
  const [globalPlayers, setGlobalPlayers] = useState({
    Pitcher: { name: "", id: "" },
    Catcher: { name: "", id: "" },
    First: { name: "Add Player", id: "" },
    Second: { name: "Add Player", id: "" },
    Third: { name: "Add Player", id: "" },
    Shortstop: { name: "Add Player", id: "" },
    Left: { name: "Add Player", id: "" },
    Center: { name: "Add Player", id: "" },
    Right: { name: "Add Player", id: "" },
  });

  return (
    <GlobalContext.Provider value={{ globalPlayers, setGlobalPlayers }}>
      {children}
    </GlobalContext.Provider>
  );
};
